<html>
  <head>
    <meta charset="UTF-8" />
    <title>출력결과</title>
  </head>
  <body>
    <script>
      function solution(s) {
        let obj = {};
        for (let ele of s) {
          if (obj[ele] === undefined) {
            obj[ele] = ele;
          }
        }
        answer = Object.keys(obj);

        return answer;
      }
      let str = ["good", "time", "good", "time", "student"];
      console.log(...solution(str));
    </script>
  </body>
</html>
